import React from 'react';
import { Link } from "react-router-dom";

const Navbar = () => {
    return (
        <nav>
            <Link to="/home">Home</Link>
            <Link to="/posts">Posts</Link>
            <Link to="/profile">Profile</Link>

        </nav>
    );
}
export default Navbar;
